#
# Fully qualified AFS command paths for rpm-based installs.
#
AKLOG = "/usr/bin/aklog"
ASETKEY = "/usr/sbin/asetkey"
BOS = "/usr/bin/bos"
FS = "/usr/bin/fs"
PAGSH = "/usr/bin/pagsh"
PTS = "/usr/bin/pts"
RXDEBUG = "/usr/sbin/rxdebug"
TOKENS = "/usr/bin/tokens"
UDEBUG = "/usr/bin/udebug"
UNLOG = "/usr/bin/unlog"
VOS = "/usr/sbin/vos"
